import logo from './logo.svg';
import './App.css';
import React, { useState } from 'react';

function App() {

  const [count, setCount] = useState(0);
  const [show, setShow] = useState(false);

  function Hide({type}){
    return (
      <h1> {type} </h1>
    )
  }

  return (
    <div className="App">
      <div id="header">
            <div class="logo">
                <span class="icon fa-chart-bar"></span>
            </div>
            <div class="content">
                <div class="inner">
                    <h1>Desafio Indwise</h1>
                    <p> análise exploratória de dados</p>
                </div>
            </div>
            <nav>
                <ul>
                    <li><a href="#intro">Sobre</a></li>
                    <li><a href="#work">Gráficos</a></li>
                    <li><a href="#contact">Contato</a></li>
                </ul>
            </nav>
        </div>          
    </div>
  );
}

export default App;
